@import url('https://fonts.googleapis.com/css2?family=Nanum+Gothic&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Maven+Pro&display=swap');

$background-color : #2f2f2f;
$primary-color : #32c1c4;
$second-color : #26c984;

body {

  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    list-style: none;
    text-decoration: none;
    color: #2f2f2f;
    font-family: 'Nanum Gothic', 'Maven Pro', sans-serif;
  }

  img {
    width: 200px;
  }

  h1 {
    font-size: 7rem;
    font-weight: 800;
    color: $primary-color;
  }

  h2 {
    font-size: 4rem;
    font-weight: 800;
    line-height: 4.2rem;
    color: $primary-color;
  }

  h3 {
    font-size: 3rem;
    font-weight: 800;
    color: $primary-color;
  }

  h4 {
    font-size: 2rem;
    font-weight: 800;
    line-height: 2.5rem;
  }

  h5 {
    font-size: 1.5rem;
    font-weight: 600;
  }

  h6 {
    font-size: 1.2rem;
    font-weight: 600;
    line-height: 1.5rem;
  }

  p {
    font-size: 1rem;
    font-weight: 600;
    line-height: 1.5rem;
  }

  i {
    color: $primary-color;
    margin-right: 1rem;
    font-size: 1.5rem;
  }

  .container {
    width: 1200px;
    margin: 0 auto;
  }

  .btn-primary {
    background-color: transparent;
    color: transparent;
    border: none;

    span {
      position: relative;
      z-index: 2;
      user-select: none;
      padding: 10px;
      transition: color 1s ease;
      -webkit-transition: color 1s ease;
      -moz-transition: color 1s ease;
      -o-transition: color 1s ease;
      -ms-transition: color 1s ease;
      font-weight: 600;
      color: #fff;
      border-bottom: 3px solid #fff;
      margin-bottom: 15px !important;
      font-size: 16px !important;
      display: inline-block !important;

      &:focus,
      &:hover {
        outline: 0;
        color: $primary-color;
        -webkit-transition: color 1s ease;
        -moz-transition: color 1s ease;
        -o-transition: color 1s ease;
        -ms-transition: color 1s ease;
        transition: color 1s ease;
        cursor: pointer;
      }

      &:after,
      &:before {
        -webkit-transition: all 1s ease 0s;
        -moz-transition: all 1s ease 0s;
        -o-transition: all 1s ease 0s;
        -ms-transition: all 1s ease 0s;
        transition: all 1s ease 0s;
      }

      &:focus:after,
      &:focus:before,
      &:hover:after,
      &:hover:before {
        outline: 0;
        background-color: $primary-color;
        -webkit-transition: all 1s ease 0s;
        -moz-transition: all 1s ease 0s;
        -o-transition: all 1s ease 0s;
        -ms-transition: all 1s ease 0s;
        transition: all 1s ease 0s;
      }

      &:before {
        position: absolute;
        z-index: -1;
        width: 3px;
        height: 100%;
        left: 0;
        content: "";
        top: 0
      }

      &:focus:before,
      &:hover:before {
        width: 100%;
        height: 100%;
      }

      &:hover {
        color: #fff !important;
      }
    }
  }

  // MAIN
  main {
    height: 800px;
    text-align: center;
    position: relative;

    .main__txt {
      width: 100%;
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);

      h1 {
        margin: 3rem auto;
      }
    }

    .button_container {
      position: absolute;
      top: 5rem;
      right: 5rem;
      height: 20px;
      width: 40px;
      cursor: pointer;
      z-index: 100;
      transition: opacity 0.25s ease;
    }

    .button_container:hover {
      opacity: 1;
    }

    .button_container.active .top {
      transform: translateY(15px) translateX(0) rotate(45deg);
      background: $background-color;
    }

    .button_container.active .middle {
      opacity: 0;
      background: $background-color;
    }

    .button_container.active .bottom {
      transform: translateY(-15px) translateX(0) rotate(-45deg);
      background: $background-color;
    }

    .button_container span {
      background: $background-color;
      border: none;
      height: 5px;
      width: 100%;
      position: absolute;
      top: 0;
      left: 0;
      transition: all 0.35s ease;
      cursor: pointer;
    }

    .button_container span:nth-of-type(2) {
      top: 15px;
    }

    .button_container span:nth-of-type(3) {
      top: 30px;
    }

    .overlay {
      position: fixed;
      background: $second-color;
      top: 0;
      left: 0;
      width: 100%;
      height: 0%;
      opacity: 0;
      visibility: hidden;
      transition: opacity 0.35s, visibility 0.35s, height 0.35s;
      overflow: hidden;
      display: flex;
      justify-content: space-around;

      .o__intriduce {
        text-align: left;

        li {
          font-size: 2rem;
          height: 50px;
          color: $background-color;
          margin-left: 0rem;
          font-weight: 600;

          i {
            margin: 0;
            color: #fff;
          }

          &:nth-child(1) {
            margin-bottom: 300px;
          }
        }
      }

      .middle-bar {
        width: 5px;
        height: 90%;
        background-color: $background-color;
        position: absolute;
        top: 3rem;
      }

      .site {
        display: flex;
        flex-direction: column;
        align-items: flex-start;
        text-align: left;

        ul {
          &:nth-child(1) {
            margin-bottom: 3rem;
          }

          li:nth-child(1) {
            margin-bottom: 2rem;
            color: $background-color;
            font-weight: 800;
          }
        }
      }
    }

    .overlay.open {
      opacity: 1;
      visibility: visible;
      height: 100%;
      z-index: 50;

      li {
        animation: fadeInRight 0.5s ease forwards;
        animation-delay: 0.35s;

        &:nth-of-type(2) {
          animation-delay: 0.4s;
        }

        &:nth-of-type(3) {
          animation-delay: 0.45s;
        }

        &:nth-of-type(4) {
          animation-delay: 0.5s;
        }

        &:nth-of-type(5) {
          animation-delay: 0.55s;
        }

        &:nth-of-type(6) {
          animation-delay: 0.6s;
        }
      }
    }

    .overlay nav {
      position: relative;
      height: 70%;
      top: 50%;
      transform: translateY(-50%);
      font-size: 50px;
      font-weight: 400;
      text-align: center;

      ul {
        list-style: none;
        padding: 0;
        margin: 0 auto;
        display: inline-block;
        position: relative;

        li {
          display: block;
          position: relative;
          opacity: 0;
          font-size: 3rem;
          margin-bottom: 1rem;

          a {
            display: block;
            position: relative;
            color: #FFF;
            text-decoration: none;
            font-size: 2rem;
            font-weight: 600;
            padding-bottom: 0.5rem;
          }

          a:hover:after,
          .overlay ul li a:focus:after,
          .overlay ul li a:active:after {
            width: 80%;
          }

          a:after {
            content: "";
            position: absolute;
            bottom: 0;
            left: 40%;
            width: 0%;
            transform: translateX(-50%);
            height: 3px;
            background: #FFF;
            transition: 0.5s;
          }
        }
      }
    }

    @keyframes fadeInRight {
      0% {
        opacity: 0;
        left: 20%;
      }

      100% {
        opacity: 1;
        left: 0;
      }
    }
  }

