  // REDESIGN
  .redesign {
    margin: 0 auto;
    padding: 5rem 0 10rem;
    background-color: $second-color;

    h2 {
      margin-bottom: 2rem;
      color: #fff;
    }

    .slick-slide {
      width: 300px;
      margin: 0 1rem;
      border-radius: 20px;
      padding: 2rem;
      position: relative;
      transition: all 0.8s;
      cursor: pointer;

      &:hover {
        background-color: $background-color;

        p,
        h4 {
          color: #fff;
        }
      }

      h4 {
        margin: 1rem 0;
      }

      img {
        width: 300px;
        height: 200px;
        border-radius: 10px;
      }

      .img__opacity {
        width: 300px;
        height: 200px;
        border-radius: 10px;
        background-color: rgba(#2f2f2f, 0.6);
        position: absolute;
        bottom: 2rem;
        left: 2rem;
        z-index: 10;
      }

      &:hover .img__opacity {
        background-color: rgba(#2f2f2f, 0);
      }
    }

    .slick-prev.slick-arrow,
    .slick-next.slick-arrow {
      width: 65px;
      height: 65px;
      border: 0px;
      background: none;
      z-index: 10;
      position: absolute;
      bottom: -8rem;
      left: -5rem;
      transform: translate(0, -50%);
      font-size: 0rem;
      color: transparent;
      cursor: pointer;
      transition: 0.3s;
    }

    .slick-next.slick-arrow {
      left: 100%;
    }

    .slick-prev.slick-arrow:before {
      content: "\f060";
      font-family: "Font Awesome 5 Free";
      font-weight: 600;
      color: #fff;
      background: none;
      font-size: 2rem;
      padding: 0.5rem 0.8rem;
      text-decoration-line: none;
      transition: 0.8s;
    }

    .slick-next.slick-arrow:before {
      content: "\f061";
      font-family: "Font Awesome 5 Free";
      font-weight: 600;
      color: #fff;
      background: none;
      font-size: 2rem;
      padding: 0.5rem 0.8rem;
      text-decoration-line: none;
      transition: 0.8s;
    }

    .slick-dots {
      width: 150px;
      display: flex;
      position: absolute;
      bottom: -5rem;
      left: 50%;
      transform: translateX(-50%);
      justify-content: space-between;

      #slick-slide-control00,
      #slick-slide-control01,
      #slick-slide-control02,
      #slick-slide-control03 {
        width: 20px;
        height: 10px;
        font-size: 0rem;
        background: #fff;
        border: none;
        border-radius: 10px;
        margin: 0.5rem 0;
        transition: all 0.8s;
        cursor: pointer;

        &:hover,
        &:active {
          width: 60px;
        }
      }
    }
  }

